import { Component } from "react";
import { Carousel } from "react-bootstrap";

class MovieSlider extends Component {
  render() {
    return (
      <div>
        <Carousel>
          <Carousel.Item>
            <img
              src="https://media.istockphoto.com/id/517188688/photo/mountain-landscape.jpg?s=612x612&w=0&k=20&c=A63koPKaCyIwQWOTFBRWXj_PwCrR4cEoOw2S9Q7yVl8="
              alt="First slide"
              style={{ width: "200px" }}
            />
            <img src="https://pikwizard.com/photos/0b01dfa55d14b2fe0526921ae7a20699-l.jpg" alt="Second slide" style={{ width: "200px" }} />

            <img src="https://cdn.pixabay.com/photo/2014/02/27/16/10/flowers-276014__340.jpg" alt="Third slide" style={{ width: "200px" }} />
          </Carousel.Item>
          <Carousel.Item>
            <img src="https://pikwizard.com/photos/0b01dfa55d14b2fe0526921ae7a20699-l.jpg" alt="Second slide" style={{ width: "200px" }} />
          </Carousel.Item>
          <Carousel.Item>
            <img src="https://cdn.pixabay.com/photo/2014/02/27/16/10/flowers-276014__340.jpg" alt="Third slide" style={{ width: "200px" }} />
          </Carousel.Item>
        </Carousel>
      </div>
    );
  }
}

export default MovieSlider;
